import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './pages/HomePage';

// –ü—Ä–æ—Å—Ç—ã–µ –∑–∞–≥–ª—É—à–∫–∏ –¥–ª—è –æ—Å—Ç–∞–ª—å–Ω—ã—Ö —Å—Ç—Ä–∞–Ω–∏—Ü
const PriceListTemp = () => (
  <div style={{
    minHeight: '100vh',
    background: 'linear-gradient(135deg, #000 0%, #1a0000 100%)',
    color: 'white',
    padding: '50px',
    textAlign: 'center'
  }}>
    <h1 style={{ color: 'red', fontSize: '48px' }}>üìã –ü–†–ê–ô–°-–õ–ò–°–¢</h1>
    <p style={{ fontSize: '24px', marginTop: '30px' }}>–°–∫–æ—Ä–æ –∑–¥–µ—Å—å –ø–æ—è–≤–∏—Ç—Å—è –∏–Ω—Ç–µ—Ä–∞–∫—Ç–∏–≤–Ω—ã–π –ø—Ä–∞–π—Å-–ª–∏—Å—Ç!</p>
  </div>
);

const GameTemp = () => (
  <div style={{
    minHeight: '100vh',
    background: 'linear-gradient(135deg, #000 0%, #001a1a 100%)',
    color: 'white',
    padding: '50px',
    textAlign: 'center'
  }}>
    <h1 style={{ color: '#00ff00', fontSize: '48px' }}>üéÆ –ù–ê–ô–î–ò –û–®–ò–ë–ö–£</h1>
    <p style={{ fontSize: '24px', marginTop: '30px' }}>–ò–≥—Ä–∞ –¥–ª—è –ø–æ–ª—É—á–µ–Ω–∏—è —Å–∫–∏–¥–∫–∏ 10%!</p>
  </div>
);

const ContactsTemp = () => (
  <div style={{
    minHeight: '100vh',
    background: 'linear-gradient(135deg, #000 0%, #1a001a 100%)',
    color: 'white',
    padding: '50px',
    textAlign: 'center'
  }}>
    <h1 style={{ color: '#ff00ff', fontSize: '48px' }}>üìû –ö–û–ù–¢–ê–ö–¢–´</h1>
    <p style={{ fontSize: '24px', marginTop: '30px' }}>
      <strong style={{ color: 'red' }}>Telegram:</strong> @Lyokorps
    </p>
  </div>
);

function App() {
  return (
    <Router>
      <div style={{
        minHeight: '100vh',
        background: '#000000',
        fontFamily: 'Arial, sans-serif'
      }}>
        <Navbar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/pricelist" element={<PriceListTemp />} />
          <Route path="/game" element={<GameTemp />} />
          <Route path="/contacts" element={<ContactsTemp />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
